@-moz-document domain("roblox.com") {
@keyframes rainbow {
    0% {background-color: #aaf0c1;border-color: #aaf0c1;}
    14% {background-color: #aaf0c1;border-color: #aaf0c1;}
    28% {background-color: #aaf0c1;border-color: #aaf0c1;}
    42% {background-color: #aaf0c1;border-color: #aaf0c1;}
    56% {background-color: #aaf0c1;border-color: #aaf0c1;}
    80% {background-color: #aaf0c1;border-color: #aaf0c1;}
    94% {background-color: #aaf0c1;border-color: #aaf0c1;}
    100% {background-color: #aaf0c1;border-color: #aaf0c1;}
}

.btn-common-play-game-lg {
    animation: rainbow 10s infinite;
  }
.rbx-header {
    animation: rainbow 10s infinite;
}
.btn-growth-lg {
    animation: rainbow 10s infinite;
}
#chat-header {
	  animation: rainbow 10s infinite;
}

}
